import React from 'react';

function App() {
  return (
    <div>
      {/* Encabezado */}
      <header style={styles.header}>
        <div style={styles.logo}>fondos.com</div>
        <div style={styles.spacer}></div>
        <div style={styles.navItem}>Registrarse</div>
        <div style={styles.navItem}>Ayuda</div>
        <div style={styles.navItem}>Nombre Función</div>
      </header>

      {/* Barra de Navegación */}
      <nav style={styles.navbar}>
        <div style={styles.navItem}>Función 1</div>
        <div style={styles.navItem}>Función 2</div>
        <div style={styles.navItem}>Función 3</div>
      </nav>

      {/* Hero */}
      <section style={styles.hero}>
        <h1>Bienvenidos a Fondos.com</h1>
        <p>Tu sitio de información y servicios financieros</p>
      </section>

      {/* Secciones */}
      <section style={styles.section}>
        <h2>Nav 1</h2>
        <p>Contenido para la primera sección de navegación.</p>
      </section>

      <section style={styles.section}>
        <h2>Nav 2</h2>
        <p>Contenido para la segunda sección de navegación.</p>
      </section>
    </div>
  );
}

const styles = {
  header: {
    display: 'flex',
    alignItems: 'center',
    padding: '10px 20px',
    backgroundColor: '#f8f9fa',
  },
  logo: {
    fontSize: '1.5em',
    fontWeight: 'bold',
  },
  spacer: {
    flexGrow: 1,
  },
  navItem: {
    marginLeft: '20px',
    cursor: 'pointer',
  },
  navbar: {
    display: 'flex',
    justifyContent: 'space-around',
    padding: '10px 0',
    backgroundColor: '#343a40',
    color: 'white',
  },
  hero: {
    padding: '40px 20px',
    backgroundColor: '#e9ecef',
    textAlign: 'center',
  },
  section: {
    padding: '20px',
    borderBottom: '1px solid #dee2e6',
  },
};

export default App;
